import { useState } from "react";
import { useNavigate } from "react-router-dom";

function Add() {
    const [product, setproduct] = useState({});
    const navigate = useNavigate();
    return (
        <>
            <div className="container px-5 my-5">
                <form id="contactForm" data-sb-form-api-token="API_TOKEN">
                    <div className="form-floating mb-3">
                        <input className="form-control" id="id" type="text" placeholder="id" data-sb-validations="required" 
                        onChange={(e)=>{
                            setproduct({...product,id:e.target.value})
                        }}
                        />
                        <label for="id">id</label>
                        <div className="invalid-feedback" data-sb-feedback="id:required">id is required.</div>
                    </div>
                    <div className="form-floating mb-3">
                        <input className="form-control" id="name" type="text" placeholder="Name" data-sb-validations="required" 
                        onChange={(e)=>{
                            setproduct({...product,name:e.target.value})
                        }}
                        />
                        <label for="name">Name</label>
                        <div className="invalid-feedback" data-sb-feedback="name:required">Name is required.</div>
                    </div>
                    <div className="form-floating mb-3">
                        <input class="form-control" id="image" type="text" placeholder="Image" data-sb-validations="required"
                        onChange={(e)=>{
                            setproduct({...product,image:e.target.value})
                        }}
                        />
                        <label for="image">Image</label>
                        <div className="invalid-feedback" data-sb-feedback="image:required">Image is required.</div>
                    </div>
                    <div className="form-floating mb-3">
                        <input className="form-control" id="price" type="text" placeholder="Price" data-sb-validations="required"
                        onChange={(e)=>{
                            setproduct({...product,price:e.target.value})
                        }}
                        />
                        <label for="price">Price</label>
                        <div className="invalid-feedback" data-sb-feedback="price:required">Price is required.</div>
                    </div>
                    <div className="form-floating mb-3">
                        <textarea className="form-control" id="description" type="text" placeholder="description" style={{height: "10rem"}} data-sb-validations=""
                        onChange={(e)=>{
                            setproduct({...product,dictionary:e.target.value})
                        }}
                        />
                        <label for="description">description</label>
                    </div>
                    <div className="d-none" id="submitSuccessMessage">
                        <div className="text-center mb-3">
                            <div className="fw-bolder">Form submission successful!</div>
                            <p>To activate this form, sign up at</p>
                            <a href="https://startbootstrap.com/solution/contact-forms">https://startbootstrap.com/solution/contact-forms</a>
                        </div>
                    </div>
                    <div className="d-none" id="submitErrorMessage">
                        <div className="text-center text-danger mb-3">Error sending message!</div>
                    </div>
                    <div className="d-grid">
                        <button className="btn btn-primary btn-lg disabled" id="submitButton" type="submit"
                        onClick={()=>{
                            fetch('http://localhost:4000/plastic/add',{
                                method: 'POST',
                                body:JSON.stringify(product),
                                headers: {
                                    'Content-Type': 'application/json',
                                    },

                            })
                            .then(()=>{
                                navigate("/Plastic")
                            })
                        }}
                        >Submit</button>
                    </div>
                </form>
            </div>
            {/* <script src="https://cdn.startbootstrap.com/sb-forms-latest.js"></script> */}
        </>
    )
}
 
export default Add;
